 p_id=>wwv_flow_api.id(68082598525707930)
,p_plug_name=>'Comments <strong>&P4_COMMENT_COUNT.</strong>'
,p_region_template_options=>'#DEFAULT#:t-Region--scrollBody'
,p_plug_template=>wwv_flow_api.id(78532807684867694)
,p_plug_display_sequence=>60
,p_include_in_reg_disp_sel_yn=>'Y'
,p_plug_display_point=>'BODY'
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'declare',
'v_count number;',
'begin',
'    begin',
'        select count(1) ',
'        into v_count from post_comment',
'        where post_id = :P4_ID;',
'        exception when others then v_count := 0;',
'    end;',
'    ',
'    if v_count > 0 then',
'',
'    htp.p(''<div class="t-Region-body container">'');',
'    htp.p(''<div id="comment-contents">'');',
'    for i in (',
'      select',
'        pc.id,',
'        --user_icon, -- use apex_string.get_initials(str) to get initials',
'        pc.created_by,',
'        pc.comment_Description comment_text,',
'        apex_util.get_since(pc.updated_on) last_updated,',
'        ''Edit'' actions,',
'        f_get_inline(:app_id,:app_session,pc.created_by,''APP_USER'') user_icon_url,',
'        apex_util.prepare_url(''f?p=''||:app_id||'':17:''||:app_session||''::NO::P17_ID:''||pc.id) edit_url,',
'        case when lower(pc.created_by) = lower(:APP_USER) then 1 else 0 end edit_access,',
'        (select apex_util.prepare_url(''f?p=''||:app_id||'':25:''||:app_session||''::NO::P25_ID:''||au.id) from app_user au where lower(au.email) = lower(pc.created_by)) link',
'      from post_comment pc',
'      where pc.post_id = :P4_ID',
'      order by case when lower(pc.created_by) = lower(:APP_USER) then 1 else 2 end, pc.created_on desc) loop',
'',
'    htp.p(''<div class="t-Region t-Region-body container">'');',
'    htp.p(''<div class="comment">'');',
'    htp.p(''<div class="col col-12">'');',
'        htp.p(''<div class="col col-1">'');',
'        if i.edit_access = 1 then',
'            htp.p(''<a href="''||i.edit_url||''" class="t-Button t-Button--icon t-Button--iconLeft"><span aria-hidden="true" class="t-Icon t-Icon--left fa fa-pencil"></span>Edit</a>'');',
'        end if;',
'        htp.p(''</div>'');',
'        htp.p(''<div class="col col-1" style="text-align:center">'');',
'            htp.p(''<div class="author_thumbnail">'');',
'            htp.p(''<img class="comment-user-icon" src="''||i.user_icon_url||''" width="40" height="40"></img>'');',
'            htp.p(''</div>'');',
'        htp.p(''</div>'');',
'        htp.p(''<div class="col col-10">'');',
'            htp.p(''<div class="comment-main">'');',
'                htp.p(''<div class="comment-header"><a href="''||i.link||''">''||i.created_by||''</a>   <strong>''||i.last_updated||''</strong></div>'');',
'                htp.p(''<div class="comment-body">''||i.comment_text||''</div>'');',
'            htp.p(''</div>'');',
'        htp.p(''</div>'');',
'    htp.p(''</div>'');',
'    htp.p(''</div>'');',
'    htp.p(''</div>'');',
'',
'    end loop;',
'    htp.p(''</div>'');',
'    htp.p(''</div>'');',
'    ',
'    end if;',
'end;'))
,p_plug_source_type=>'NATIVE_PLSQL'
,p_plug_query_options=>'DERIVED_REPORT_COLUMNS'
,p_plug_display_condition_type=>'ITEM_IS_NOT_NULL'
,p_plug_display_when_condition=>'P4_ID'
);
