'    else',
'        if v_react_type = ''Upvote'' then',
'            update post_reaction',
'            set reaction_type = ''Upvote''',
'            where post_id = p_post_id',
'            and reacting_user_id = p_app_user_id;',
'        else ',
'            update post_reaction',
